// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.9;

contract Clocktower {

    //global struct for future transactions
    struct Transaction {
        address sender;
        address receiver;
        uint blockTrigger;
        //amount of ether sent in wei
        uint payload;
    }

    //global struct for Watchers
    struct Watcher {
        address watcherAddress;

    }

    //Initialize an array of transactions keyed to uint blocknumber.
    //This makes it very fast to look up transactions by time.
    //Map of arrays of transaction structs keyed to block number send time

    mapping(uint => Transaction[]) private timeBlocks;
    //mapping(uint => Transaction) transactions;
    //uint[] private transaction_id;

    //variable for last checked block
    uint lastCheckedBlock = 0;




    //sets Transaction
    function setTransaction(address sender, address receiver, uint blockTrigger, uint payload) pure  internal returns(Transaction memory _transaction){

            _transaction = Transaction(sender, receiver, blockTrigger, payload);
            //Transaction storage newTransaction = transactions[];

            return _transaction;

    }

    //gets transaction array from block
    function getTransactionArray(uint blockTrigger) private view returns(Transaction[] memory transactionArray){

       return timeBlocks[blockTrigger];

    }

    //sets transaction array to transaction block map
    function setTransactionArray(Transaction[] memory transactionArray, uint transactionBlock) private {
        timeBlocks[transactionBlock] = transactionArray;
    }



    //adds to list of transactions 
    function addTransaction(address receiver, uint blockTrigger, uint payload) external view {


        address sender = msg.sender;
        Transaction[] memory _transactionArray;

        //creates transaction
        Transaction memory transaction = setTransaction(sender, receiver, blockTrigger, payload);

        //Looks up array for blockTrigger. If no array exists it populates it. If it already does it appends it.
        _transactionArray = getTransactionArray(blockTrigger);     
        uint _length = _transactionArray.length;
        //no array exists
        if(_length == 0){
            _transactionArray[0] = transaction;
        } else {
            _transactionArray[_length + 1] = transaction;
        }

    }


    //checks list of blocks between now and when it was last checked
    function checkTime() public returns(Transaction[] memory transactionList) {

        uint _currentBlock = block.number;
        uint counter = 0;


        for(uint i = lastCheckedBlock; i <= _currentBlock; i++) {

            Transaction[] memory _transactionArray;

            //gets transaction array per block
            _transactionArray = timeBlocks[i];

            //if block has transactions add them to transaction list
            if(_transactionArray.length != 0) {

                //iterates through transaction array
                for(uint h = 0; h <= _transactionArray.length; h++){

                    transactionList[counter] = _transactionArray[h];
                    counter++;
                }               
            }
        }
    }

    //gets block number based on timestamp
    function getBlockFromTime(uint _timestamp) internal {

    }
}

